demo.repl.help:
الأوامر المتاحة:
  @show              ─ اعرض ملخص آخر بطاقة تكيفية
  @json              ─ أخرج قيمة JSON الخام المستلمة من التدفق
  @back              ─ ارجع إلى البطاقة/المدخلات المحظورة السابقة
  @input <k>=<v>     ─ عيّن أو تجاوز حقل إدخال
  @click <action_id> ─ أرسل البطاقة باستخدام الإجراء المقدم
  @help              ─ اطبع نص المساعدة هذا
  @quit              ─ اخرج من REPL
